import React from "react";
import { TETROMINOS } from "../../tetrominos";

const Cell = (props) => (
  <div
    type={"L"}
    style={{
      backgroundColor: `${TETROMINOS["L"].color}`,
      border: `${TETROMINOS[0] === 0 ? "0px solid" : "0.5px solid"}`,
      padding: "11px",
      boxShadow: "5px 10px",
    }}
  ></div>
);

export default Cell;
